    alphan=d(n)-wold'*phin;
    Pnew=Pold-[(Pold*(phin*phin')*Pold')/(1+phin'*Pold*phin)];
    wnew=wold+Pnew*phin*alphan;
     wold=wnew;
    Pold=Pnew;
    y(n)=wnew'*phin;
end

y=y*stdy+meany;  
d=d*stdy+meany;  


figure(1)
plot([1:1:length(X)],d,[1:1:length(X)],y)

